import './categories.styles.scss';

const App = () => {

  const categories = [
    {
      "id": 1,
      "title": "hats",
      "imageUrl": "https://preview.redd.it/ro5higesdku51.jpg?auto=webp&s=ed7fc411736cb66acec284983e96d5973a6618fd"
    },
    {
      "id": 2,
      "title": "jackets",
      "imageUrl": "https://process.fs.grailed.com/reDn8Oy8RQSbtWibChru"
    },
    {
      "id": 3,
      "title": "sneakers",
      "imageUrl": "https://media.gq.com/photos/60d21a25ab6b8cc6e9d2c80a/3:4/w_2700,h_3600,c_limit/SNEAKER_GUIDE_OPENER.jpg"
    },
    {
      "id": 4,
      "title": "womens",
      "imageUrl": "https://i.ibb.co/GCCdy8t/womens.png"
    },
    {
      "id": 5,
      "title": "mens",
      "imageUrl": "https://assets.myntassets.com/dpr_1.5,q_60,w_400,c_limit,fl_progressive/assets/images/13137110/2021/7/27/c99daa64-2b84-415c-8129-3a25658fe9cd1627373261770HIGHLANDERMenGreenSolidDenimJacket1.jpg"
    }
  ]
  return (
      <div className = "categories-container">
          {categories.map(({title, id, imageUrl })=>(
              <div key = {id}className = "category-container">
              <div className='background-image' style ={{
                backgroundImage: `url(${imageUrl})`
              }} />
                <div className = "category-body-container">
                  <h2>{title}</h2>
                  <p>Shop Now</p>
                </div>
            </div>
          ))}
      </div>
  );
}

export default App;
